import React from 'react';

import { useSelector } from 'react-redux';
import { selectData } from './reducer';


export const DISPLAY = () => {

    const selectTodos = useSelector(selectData);

    return (
        <div>
            {

                selectTodos.todo.map(
                    each => {
                        return (
                            <div>
                                <div>{each}</div>
                                <div>
                                    <button ></button>
                                </div>
                            </div>

                        );
                    }   
                )
            }
        </div>
    );
}
